-- Estructura de tabla para la tabla `bultacos`
-- 

CREATE TABLE `bultacos` (
  `indise` int(11) NOT NULL default '0',
  `id` int(11) NOT NULL default '0',
  `modelo` tinytext NOT NULL,
  `any` year(4) NOT NULL default '0000',
  `any_2` year(4) NOT NULL default '0000',
  `de_1` varchar(15) NOT NULL default '',
  `hasta_1` varchar(15) NOT NULL default '',
  `de_2` varchar(15) NOT NULL default '',
  `hasta_2` varchar(15) NOT NULL default '',
  `de_3` varchar(15) NOT NULL default '',
  `hasta_3` varchar(15) NOT NULL default '',
  `logo1` varchar(50) NOT NULL default '',
  `logo2` varchar(50) NOT NULL default '',
  `img1` varchar(50) NOT NULL default '',
  `img2` varchar(50) NOT NULL default '',
  `img3` varchar(50) NOT NULL default '',
  `carburador` varchar(50) NOT NULL default '',
  `cuadro` varchar(50) NOT NULL default '',
  `encendido` varchar(50) NOT NULL default '',
  `electrico` varchar(50) NOT NULL default '',
  `escape` varchar(50) NOT NULL default '',
  `filtro` varchar(50) NOT NULL default '',
  `freno_del` varchar(50) NOT NULL default '',
  `freno_tras` varchar(50) NOT NULL default '',
  `manillar` varchar(50) NOT NULL default '',
  `motor` varchar(50) NOT NULL default '',
  `pata_arranque` varchar(50) NOT NULL default '',
  `puno_gas` varchar(50) NOT NULL default '',
  `reuda_del` varchar(50) NOT NULL default '',
  `selector` varchar(50) NOT NULL default '',
  `suspension_del` varchar(50) NOT NULL default '',
  `suspension_tras` varchar(50) NOT NULL default '',
  `transmision_prim` varchar(50) NOT NULL default '',
  `transmision_sec` varchar(50) NOT NULL default '',
  KEY `indise` (`indise`)
) TYPE=MyISAM;

